	add("scuppernong", "{\"term\":\"scuppernong\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"Named after the w:Scuppernong River (North Carolina)|Scuppernong River and Lake in North Carolina near which the grapes were first found and cultivated. Probably from an word.\u0026lt;ref\u0026gt;Bland Simpson and Ann Cary Simpson, in \u0027Into the Sound Country: A Carolinian\u0027s Coastal Plain\u0027, suggest \u0026quot;Askúponong\u0026quot;\u0026lt;/ref\u0026gt; Both senses, \u0026quot;grape\u0026quot; and \u0026quot;wine\u0026quot;, are first found in documents from the 1800s-1820s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large greenish-bronze grape native to the Southeastern United States, a variety of the muscadine grape (\u0027Vitis rotundifolia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A sweet, golden or amber-colored US wine made from this variety of grape\", \"priority\":2}]}, \"synonyms\":{}}");

