	add("scuttlebutt", "{\"term\":\"scuttlebutt\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|scuttle|butt|lang\u003den}}. In sense of gossip, because sailors would gather around the \u0027\u0027scuttlebutt\u0027\u0027 to drink and exchange gossip; compare \u0027water cooler\u0027 and \u0027furphy\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A butt with a scuttle, a keg of drinking water with a hole cut in it, on board ship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, John Wheatcroft, \u0027Slow Exposures\u0027, [http://books.google.com.au/books?id\u003dcAbyae_w9BMC\u0026amp;pg\u003dPA114\u0026amp;dq\u003d%22scuttlebutt%22\u0026amp;hl\u003den\u0026amp;ei\u003dZxXBTaaRKYSsugPjnsitBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d86\u0026amp;ved\u003d0CLMDEOgBMF\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scuttlebutt%22\u0026amp;f\u003dfalse page 114\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Leaning over the \u0027\u0027scuttlebutt\u0027\u0027 one afternoon, Bond suddenly realized he\u0027d been gulping water for maybe a minute\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Paul Stillwell, \u0027Battleship Arizona: An Illustrated History\u0027, [http://books.google.com.au/books?id\u003dRBmfJYzwapIC\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22scuttlebutt%22\u0026amp;hl\u003den\u0026amp;ei\u003dZxXBTaaRKYSsugPjnsitBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d91\u0026amp;ved\u003d0CMwDEOgBMF\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scuttlebutt%22\u0026amp;f\u003dfalse page 79\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"During the midwatch a radioman striker (that is, a seaman trying to advance to radioman third class) was taking a drink of water from the third-deck \u0027\u0027scuttlebutt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Joseph A. Springer, \u0027Inferno: The Epic Life and Death Struggle of the USS Franklin in World War II\u0027, [http://books.google.com.au/books?id\u003d-4gBX6nCumUC\u0026amp;pg\u003dPA218\u0026amp;dq\u003d%22scuttlebutt%22\u0026amp;hl\u003den\u0026amp;ei\u003dqRvBTaLoJoKyvwPpm4SbBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d74\u0026amp;ved\u003d0CPgCEOgBMEk4Z\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scuttlebutt%22\u0026amp;f\u003dfalse page 218\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"We all grabbed towels that belonged to whoever lived there, and we wet them down in the \u0027\u0027scuttlebutt\u0027\u0027 and wrapped them around our faces to filter out as much smoke as possible\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Gossip, rumour, idle chatter\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1962\u0027\u0027, Richard McKenna, \u0027The Sand Pebbles\u0027, [http://books.google.com.au/books?id\u003dsw5bAAAAMAAJ\u0026amp;q\u003d%22scuttlebutt%22\u0026amp;dq\u003d%22scuttlebutt%22\u0026amp;hl\u003den\u0026amp;ei\u003dqRvBTaLoJoKyvwPpm4SbBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDkQ6AEwAzhk page 137\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"quot;That\u0027s the \u0027\u0027scuttlebutt\u0027\u0027,\u0026quot; Bronson said defiantly. \u0026quot;You got some pet coolie down there you want to put in Chien\u0027s place.\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Len Custer, \u0027Called to Serve: A Historical Novel of the Korean War\u0027, [http://books.google.com.au/books?id\u003d_aI_wiXr_rEC\u0026amp;pg\u003dPA211\u0026amp;dq\u003d%22scuttlebutt%22\u0026amp;hl\u003den\u0026amp;ei\u003dZxXBTaaRKYSsugPjnsitBA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d39\u0026amp;ved\u003d0CNkBEOgBMC\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22scuttlebutt%22\u0026amp;f\u003dfalse page 211\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"His resolve not to worry about unfounded \u0027\u0027scuttlebutt\u0027\u0027 lasted about two minutes\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 3\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Since their orders had come through, the “\u0027\u0027scuttlebutt\u0027\u0027” among the excited and curious crew had been of little besides the fabled “White City”\", \"priority\":18}]}, \"synonyms\":{}}");

	add("scutwork", "{\"term\":\"scutwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Combination of scut (a worthless person) and work\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"tasks that are tedious and monotonous or trivial and menial, usually inherent in the operations of a larger projec\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Harvey Robbins and Michael Finley, \u0027The New Why Teams Don\u0027t Work: What Goes Wrong and How to Make It Right\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Everyone on a team must pull their fair share of \u0027\u0027scutwork\u0027\u0027 if the team is to succeed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Julia Spencer-Fleming, \u0027In the Bleak Midwinter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hard to keep that edge of horror over the death of another human being when it was surrounded by so much tedious \u0027\u0027scutwork\", \"priority\":5}]}, \"synonyms\":{}}");

